import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Navbar from "./componentes/estaticos/navbar/Navbar";
import Footer from "./componentes/estaticos/footer/Footer";
import Login from "./paginas/login/Login";
import Home from "./paginas/home/Home";
import CadastroUsuario from "./paginas/cadastroUsuario/CadastroUsuario";
import "./App.css";
import ListaTema from "./componentes/temas/listatema/ListaTema";
import ListaPostagem from "./componentes/postagens/listapostagem/ListaPostagem";
import CadastroPost from "./componentes/postagens/cadastrarPost/CadastrarPost";
import CadastroTema from "./componentes/temas/cadastroTema/CadastroTema";
import DeletarTema from "./componentes/temas/deletarTema/DeletarTema";
import DeletarPostagem from "./componentes/postagens/deletarPost/DeletarPost";

function App() {
  return (
    <Router>
      <Navbar />
      <div style={{ minHeight: "100vh" }}>
        <Routes>
          <Route path="/" element={<Login />} />
          <Route path="/login" element={<Login />} />
          <Route path="/home" element={<Home />} />
          <Route path="/cadastrousuario" element={<CadastroUsuario />} />
          <Route path="/postagem" element={<ListaPostagem />} />
          <Route path="/temas" element={<ListaTema />} />
          <Route path="/formularioPostagem" element={<CadastroPost />} />
          <Route path="/formularioPostagem/:id" element={<CadastroPost />} />
          <Route path="/formularioTema" element={<CadastroTema />} />
          <Route path="/formularioTema/:id" element={<DeletarTema />} />
          <Route path="/deletarTema/:id" element={<DeletarPostagem />} />
          <Route path="/deletarPostagem/:id" element={<DeletarPostagem />} />
          
        </Routes>
      </div>
      <Footer />
    </Router>
  );
}

export default App;
